import {Button, Card} from "react-bootstrap";
import Link from "next/link";

class Home extends React.Component {
  render() {
    return (
      <div>
        <h1>Home Page</h1>
        <Button href="/students" variant="solid">
          Tester Solid</Button>
        {/* </Link> */}

        <Button variant="primary" >Tester Outline</Button>
      </div>
    )
  }
}

export default Home;
